import React from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  Box,
  IconButton,
  Badge,
  Button,
} from "@mui/material";
import { ShoppingCart } from "@mui/icons-material";

export default function Header1() {
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6" fontWeight="bold">
          Eventy
        </Typography>
        <Box>
          <IconButton>
            <Badge badgeContent={4} color="secondary">
              <ShoppingCart />
            </Badge>
          </IconButton>
        </Box>
      </Toolbar>
    </AppBar>
  );
}
